  const btn = e.target;
  const row = btn.closest("tr");
  const item = 0
}
let tb_data = mapList.map((item)=>{
 return (
   <tr key={item.id}>
     <td>{item.id}</td>
     <td>{item.name}</td>
     <td>{item.width}</td>
     <td>{item.height}</td>
     <td>{item.uploaded_by}</td>
     <td>
      <button className='playBtn'onClick={() =>test()}>PLay</button>
     </td>
   </tr>
 )
})
  return(
    <div>  
        <table>
          <thead>
            <tr>
              <th>id</th>
              <th>name</th>
              <th>width</th>
              <th>height</th>
              <th>uploaded_by</th>
            </tr>
          </thead>
          <tbody>
                {tb_data}
          </tbody>
        </table>
    </div>
  )
  
}
export default MapsTable;
